DESCRIPTION:
3 high school seniors throw a birthday party to make a name for themselves but things spiral out of control as word of the party spreads. (Extended Edition)

SPECS IN BRIEF:
M4V file for iTunes/iDevices
V: 1920x1080 23.98 fps h.264 @ 5400 Kbps
